import react, { Component } from "react";
import Proyects from "./proyect.json";

class Proyect extends Component {
  state={
    info:Proyects
  }
  
  render() {
    this.state.info.Proyectos.map((e)=>(console.log(e)))
  
    return (
      <div>
        <h1 className="prtitle">Proyectos</h1>
        <div className="proyectos" id="project">
       {this.state.info.Proyectos.map((e)=>{
         var img ={
           'background':`url(${e.img})`
         }
         return(
          <div className="proyect" style={img}>
          <div className="view">
            <a href="https://cdrconsulting.pe/" target="_blank">
              Ver Trabajo
             
            </a>
          </div>
        </div>
         )
       })}
        </div>
      </div>
    );
  }
}
export default Proyect;
